import React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import "./CardsComp.css"

function CardsComp() {
  return (
    <div>
      <div >
        <Card
          sx={{ maxWidth: 345, maxHeight: 400, backgroundColor: "#EAEDED" }}
        >
          <CardMedia
            sx={{
              height: 150,
              width: 300,
              margin: " 5px auto",
              borderRadius: "5px"
            }}
            image="https://i.pinimg.com/564x/4d/69/3b/4d693b33df231e590c8c374f9e5c0f7e.jpg"
            title="green iguana"
          />
          <CardContent>
            <div>
            <span id="RAV" >
              <strong>Toyota RAv4 </strong>
            </span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <span id="yr" >  2021</span>

            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}





